    //       Learn React
    //     </a>
    //   </header>
    // </div>
    <Grid container spacing={3}>
        <Grid item xs={12}>
          <OutlinedTextField className={classes.textfield}>xs=12</OutlinedTextField>
        </Grid>
        <Grid item xs={6}>
          <OutlinedTextField className={classes.textfield}>xs=6</OutlinedTextField>
        </Grid>
        <Grid item xs={6}>
          <OutlinedTextField className={classes.textfield}>xs=6</OutlinedTextField>
        </Grid>
        <Grid item xs={3}>
          <OutlinedTextField className={classes.textfield}>xs=3</OutlinedTextField>
        </Grid>
        <Grid item xs={3}>
          <OutlinedTextField className={classes.textfield}>xs=3</OutlinedTextField>
        </Grid>
        <Grid item xs={3}>
          <OutlinedTextField className={classes.textfield}>xs=3</OutlinedTextField>
        </Grid>
        <Grid item xs={3}>
          <OutlinedTextField className={classes.textfield}>xs=3</OutlinedTextField>
        </Grid>
      </Grid>
  );
}

export default App;
